import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import NavbarFixed from "./Components/NavbarFixed";
import Sidebar from "./Components/Sidebar";
import Home from "./Components/Home";

function App() {
  return (
    <Router>
      <div className="App">
        <Sidebar />
        <Home />
      </div>
    </Router>
  );
}

export default App;
